/** @format */

import React, { Fragment } from "react";

const LedgerDoc = () => {
  return (
    <Fragment>
      <Grid container>
        <Grid item xs={4}>
          <Box
            sx={{ height: "100%", width: "100%", backgroundColor: "darkGray" }}
          ></Box>
        </Grid>
        <Grid item xs={4}></Grid>
        <Grid item xs={4}></Grid>
      </Grid>
    </Fragment>
  );
};

export default LedgerDoc;
